    public function create_task_with_aiart(Request $request)
    {

        try {

            $maskImage = file_get_contents($request->mask_image);
            $initImage = file_get_contents($request->init_image);

            $taskResponse = Http::asMultipart()->withHeaders([
                'Accept' => 'image/png',
                'Authorization' => 'sk-wD3AETBLlSc70XYlsIwEdHXVknFupZjzTIGmHtk2lEQwen6H',
            ])->attach('init_image', $initImage)->attach('mask_image', $maskImage)->post('https://api.stability.ai/v1alpha/generation/stable-inpainting-v1-0/image-to-image/masking', [
                'options' => '{
                    "mask_source": "MASK_IMAGE_WHITE",
                    "cfg_scale": 7.5,
                    "samples": 1,
                    "steps": 30,
                    "text_prompts": [{
                        "text": "' . $request->prompt . '",
                        "weight": 1
                      }]
                }'
            ]);

            if ($taskResponse->getStatusCode() == 200) {

                $base64data = 'data:image/png;base64,' . base64_encode($taskResponse);
                $maskImageBase64 = base64_decode($maskImage);
                $originalImageBase64 = base64_decode($initImage);

                $uniqid = Str::random(9);

                $imageId =  'app/realai/generated/' . $uniqid . '.png';
                $maskImageId =  'app/realai/masked/' . $uniqid . '.png';
                $originalImageId =  'app/realai/cropped/' . $uniqid . '.png';

                $finalUrl = $this->upload_to_cloudflare_with_base64($base64data, $imageId, $uniqid);

                $maskImagefinalUrl = $this->upload_to_cloudflare_with_base64($request->mask_image, $maskImageId, $uniqid);
                $originalImagefinalUrl = $this->upload_to_cloudflare_with_base64($request->init_image, $originalImageId, $uniqid);

                $imgModel = new Image;

                $imgModel->prompt = $request->prompt;
                $imgModel->url = $finalUrl;
                $imgModel->user_id = $request->device_id;
                $imgModel->masked_image_url = $maskImagefinalUrl;
                $imgModel->original_image_url = $originalImagefinalUrl;

                $imgModel->save();

                return response()->json([
                    'url' => $finalUrl,
                    'message' => 'Resim başarıyla oluşturuldu.2323'
                ], 200);
            }
        } catch (\Exception $e) {
            return response()->json([$e], 500);
        }
    }

