    public function count_using_image(Request $request)
    {
        $totalFind = AppConfig::find(131);
        $total_limit = $totalFind->value;
        $id = $request->device_id;
        $find = Image::where('user_id', '=', $id);
        $count = $find->count();
        $using = $total_limit - $count;

        return response()->json(
            [
                'total_limit' => $total_limit,
                'total_using' => $count,
                'remain' => $using
            ],
            200
        );
    }


