    public function translate_prompt($prompt)
    {

        try {

            $promptResponse = Http::withHeaders([
                'Content-Type' => 'application/json'
            ])->post('https://translation.googleapis.com/language/translate/v2?key=AIzaSyBVxtUhB8Itk3MKoE1zuUufhbHZ-B5DaIM', [
                'q' => $prompt,
                'target' => 'en',
                'format' => 'text'
            ]);

            if ($promptResponse->successful()) {

                $translations = $promptResponse['data']['translations'];

                if (isset($translations)) {

                    $translatedText = $translations[0]['translatedText'];

                    return $translatedText;
                }
            }

            return $prompt;
        } catch (S3Exception $e) {

            return $prompt;
        }
    }
